--
-- Table structure for table `order_data`
--

CREATE TABLE `order_data` (
  `order_id` int(3) NOT NULL,
  `item_category` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci,
  `item_name` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci,
  `quantity` int(3) NOT NULL,
  `item_price` decimal(5,2),
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `address_1` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci,
  `address_2` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `address_city` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci,
  `address_pincode` int(6),
  `delivery` tinyint(1) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

